import React from 'react';
import purse from './images/purse-bags';

function Quick(){
    return(
        <div style={{height: '100vh'}}>
            <div style={{borderRight: '2px solid #999393',borderBottom: '1px solid #999393', height: '30vh', width: '20vw'}}>
                <img src={purse} />
                <h3>Purse</h3>
            </div>
        </div>
    )
}

export default Quick;
